import string

source = ''

match = [(x + x.upper()) for x in string.ascii_lowercase] + [(x.upper() + x) for x in string.ascii_lowercase]

def collapse(x):
   prev_len = len(x) + 1
   while(len(x) < prev_len):
      prev_len = len(x)
      for m in match:
         x = x.replace(m, "")
   return len(x)

print(collapse(source))

full_len = len(source)
for l in string.ascii_lowercase:
   test = source.replace(l, "")
   test = test.replace(l.upper(), "")
   full_len = min(full_len, collapse(test))

print(full_len)